question:
Find all positive integers \( n \) such that there exists a positive integer \( k \) and a sequence of positive integers \( a_1, a_2, \ldots, a_k \) satisfying the following conditions:
1. \( a_1 + a_2 + \cdots + a_k = n \);
2. For every \( i \) (\( 1 \leq i \leq k \)), \( a_i \) divides \( n \);
3. \( k \) is the maximum number of terms in such a sequence.
